import React from "react";
import { NavLink } from "react-router-dom";

const Nav: React.FC = () => (
  <nav className="nav">
    <div className="nav__brand">AstraFocus <span>Nexus</span></div>
    <div className="nav__links">
      <NavLink to="/" end className={({isActive}) => isActive ? "nav__link active" : "nav__link"}>Home</NavLink>
      <NavLink to="/wellness" className={({isActive}) => isActive ? "nav__link active" : "nav__link"}>Wellness</NavLink>
      <NavLink to="/matrix" className={({isActive}) => isActive ? "nav__link active" : "nav__link"}>Matrix</NavLink>
      <NavLink to="/goals" className={({isActive}) => isActive ? "nav__link active" : "nav__link"}>Goals</NavLink>
      <NavLink to="/about" className={({isActive}) => isActive ? "nav__link active" : "nav__link"}>About</NavLink>
    </div>
  </nav>
);
export default Nav;
